export default function Slider(props) {
  return (
    <div className="slider">
      <img className="slider__img active" src={props.slides[0].url} alt="slide img"/>
      <div className="slider__text-block">
        <h2 className="slider__title"></h2>
        <h2 className="slider__subtitle"></h2>
        <span className="slider__text"></span>
      </div>
      <a className="slider__arrow-link" href='/'></a>
    </div>
  );
}
